import "./home.css";
import { AuthContext } from "../../context/AuthContext";
import { useContext, useRef, useState, useEffect } from "react";
import Navbar from "../../components/navbar/Navbar";
import UserCard from "../../components/userCard/UserCard";
import axios from 'axios';

export default function Home() {
    const { user } = useContext(AuthContext);
    const [allDoctors, setAllDoctors] = useState([]);

    useEffect(() => {
        const fetchUser = async () => {
            const res = await axios.get("/doctors/all/");
            setAllDoctors(res.data);
            console.log(res);
        };
        fetchUser();
    }, []);


    return (
        <>
            <Navbar />
            <div className="homeWrapper">
                <div className="homeTop">
                    <button className="filterBtn daily"><span className="filterBtnText">Daily</span></button>
                    <button className="filterBtn tips"><span className="filterBtnText">Tips</span></button>
                    <button className="filterBtn facts"><span className="filterBtnText">Facts</span></button>
                    <button className="filterBtn rec"><span className="filterBtnText">Recommend</span></button>
                </div>
                <div className="homeBottom">
                    <div className="homeLeft"></div>
                    <div className="homeRight"></div>
                </div>
            </div>
        </>
    );
}
